                <li><strong>Transporte</strong>: Como se deslocam (A pÃ©, Bicicleta, Carro ou Ãnibus). Transporte pÃºblico (Ãnibus) aumenta o risco de contÃ¡gio. Caminhar e pedalar significa que pegam sol.</li>
